import React from "react";
import styled from "styled-components";

const Container = styled.div`
  border: 2px solid black;
  margin-top: 5px;
`;

const CoachContactCard = () => {
  return (
    <Container>
      <h1>Coach Contact Card</h1>
    </Container>
  );
};

export default CoachContactCard;
